import React from 'react';
import { AppBar, Toolbar, IconButton, Typography, Button } from '@mui/material';
import MenuIcon from '@mui/icons-material/Menu';
import { Link } from 'react-router-dom';
import { makeStyles } from '@mui/styles';

// Custom styles for better visual structure
const useStyles = makeStyles((theme) => ({
  title: {
    flexGrow: 1,
    fontWeight: 'bold', // Makes the title bolder
  },
  button: {
    marginLeft: theme.spacing(2), // Adds space between buttons
    '&:hover': {
      backgroundColor: theme.palette.primary.light, // Hover effect
    },
  },
  appBar: {
    backgroundColor: '#2E3B55', // Custom color for the navbar
  },
}));

const Navbar = () => {
  const classes = useStyles();

  return (
    <AppBar position="static" className={classes.appBar}>
      <Toolbar>
        <IconButton edge="start" color="inherit" aria-label="menu">
          <MenuIcon />
        </IconButton>
        <Typography variant="h6" className={classes.title}>
          Travel Exchange
        </Typography>
        <Button color="inherit" component={Link} to="/" className={classes.button}>
          Home
        </Button>
        <Button color="inherit" component={Link} to="/profile" className={classes.button}>
          Profile
        </Button>
        <Button color="inherit" component={Link} to="/add-experience" className={classes.button}>
          Add Experience
        </Button>
        <Button color="inherit" component={Link} to="/login" className={classes.button}>
          Login
        </Button>
        <Button color="inherit" component={Link} to="/register" className={classes.button}>
          Register
        </Button>
      </Toolbar>
    </AppBar>
  );
};

export default Navbar;
